package 배열복습;

public class 이차원배열프린트2 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		String[][] s = {
				{"잠자기","숨쉬기","누워있기"},
				{"밥먹기","핸드폰하기","놀기"},
				{"호캉스가기","아무것도안하기","컴퓨터하기"}
		}; //전체를 프린트!
		for (int i = 0; i < s.length; i++) {
			for (int j = 0; j < s.length; j++) {
				System.out.println(s[i][j]);
				
			}
		}
		
		
		
		
		
		
		
		
		
		
		
		
		
		
		
		
		
		
		
	}

}
